import axios from "axios";

const ApiRequest = {
    Session: {
        Login: (params) => {
            return async (dispatch) => {
                try {
                  const loginResponse = await axios
                    .post('https://dev.perseo.tv/ws/Login.php', {
                      params: {
                        user: '',
                        pass: '',
                        device: 'web'
                      },
                    })
                    .then((res) => res.data);
                    console.log(res)
                } catch (err) {

                }
              };
        }
    }
}

export default ApiRequest;
